import React from "react";

import "./Projects.css";

const Project = () => {
  return (
    <div className="Project d-flex flex-column align-items-center justity-content-center">
      <div class="card" style={{ width: "15vw" }}>
        <div class="card-body">Hola</div>
      </div>
    </div>
  );
};

export default Project;
